import axios from "axios";
import choosenSong from "./songsList";

function todaysSong() {
  const song = choosenSong()
  const movieId = ''
  axios.get(`https://youtube.googleapis.com/youtube/v3/search?part=snippet&q=${song}themesong&key=AIzaSyCjkUBCiehi5ElDfmHy5-_h8yReodwjUQs
  `)
  .then(res => res.data.items[0].id.videoId)
}



// https://www.youtube.com/watch?v=

export default todaysSong
